
import { Cell } from '../../../boc/cell/cell';
import { HttpProvider } from '../../../http-provider/http-provider';
import { WalletV4ContractBase, WalletV4ContractOptions } from './wallet-v4-contract-base';


export class WalletV4ContractR1 extends WalletV4ContractBase {

    constructor(provider: HttpProvider, options: WalletV4ContractOptions) {
        options.code = Cell.oneFromBoc(
            ''
        );
        super(provider, options);
        if (!this.options.walletId) {
            this.options.walletId = 698983191 + this.options.wc;
        }
        this.methods.getPublicKey = (
            () => this.getPublicKey()
        );
    }


    public getName(): string {
        return 'v4R1';
    }

}
